import Blog from "./component/Blog/Blog";
import Brand from "./component/Brand/Brand";
import GalleryImageCard from "./component/GalleryImageCard/GalleryImageCard";
import galleryImageCardData from "./component/GalleryImageCard/GalleryImageCardData";
import ImageText from "./component/ImageText/ImageText";
import Layout from "./component/Layout/Layout";
import LogoList from "./component/LogoList/LogoList";
import NewsLetter from "./component/NewsLetter/NewsLetter";
import Testimonial from "./component/Testimonial/Testimonial";

function App() {
  return (
    <>

      <Banner />




      <LogoList />




      <ImageText />



      {/* gallerycardimage */}
      <GalleryImageCard

            title="{todo.title}"
            content="{todo.content}"
          />
      <h2>look we have have</h2>

        {galleryImageCardData.map((todo) => (
          <GalleryImageCard
            key={todo.id}
            title={todo.title}
            content={todo.content}
          />
        ))}


      {/* gallerycardimage */}
      <h2>we have</h2>
      <div >
        {galleryImageCardData.map((todo) => (
          <GalleryImageCard
            key={todo.id}
            important={todo.title === "get money" ? "red" : "blue"}
            title={todo.title}
            content={todo.content}
          />
        ))}
      </div>

      <Testimonial />


      <ImageText />

      <ImageText />



      {/* gallerycardimage */}
      <h2>we have</h2>

        {galleryImageCardData.map((todo) => (
          <GalleryImageCard
            key={todo.id}
            important={todo.title === "get money" ? "red" : "blue"}
            title={todo.title}
            content={todo.content}
          />
        ))}



      <Brand />
      <Blog />
      <NewsLetter  title="Join the lifesaver newsletter" />
    </>
  );
}

export default App;

